script: |
  super -f text -I q7037.spq | sort > q7037.out

inputs:
  - name: q7037.spq
    data: |
      SELECT DISTINCT + col0 * + col0 * + + 36 - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - - ( + + 64 ) * - - col1 * - 72 BETWEEN + - col0 * - 19 AND ( + - col1 );
  - name: tab0

outputs:
  - name: q7037.out
    data: |
      272463
      338723
      8019
